export default function updateStudentGradeByCity(students, city, newGrade) {
  return students.filter((student) => student.location === city)
    .map((student) => {
      return {
        ...student,
        grade: newGrade.find((newGradeStudent) => {
            // check if an object has a grade property, if not set it to 0
            if (newGradeStudent.grade === undefined) {
                newGradeStudent.grade = 0

            }
            console.log(newGradeStudent, 'grade')
            return newGradeStudent.studentId == student.id
        })
      }
    });
}

